import React from 'react';
import { Navbar } from 'react-bootstrap';


export default function Footer(props) {

    const { } = props;

    return(
        <Navbar fixed="bottom">
            <div>Icons made by <a href="http://www.dariusdan.com" title="Darius Dan">Darius Dan</a> from <a href="https://www.flaticon.com/" title="Flaticon">www.flaticon.com</a></div>
            <a target="_blank" href="https://icons8.com/icons/set/user-male-circle">Male User icon</a> icon by <a target="_blank" href="https://icons8.com">Icons8</a>

        </Navbar>
    );
}
